import {Grid, Typography} from '@mui/material';
import maruti from '../../assets/maruti-logo.png';


const Navbar = () => {
  return (
    <Grid container>
        <Grid><Typography sx={{backgroundColor:"blue"}}>
                <img src={maruti} alt="maruti_logo"/>
                </Typography>
                </Grid>
    </Grid>
  )
}

export default Navbar
